import time
def threeSum(nums: list[int]) -> list[list[int]]:
  numsSet = {}
  for i,n in enumerate(nums):
    if n not in numsSet:
      numsSet[n] = [i]
    else:
      numsSet[n].append(i)
  unqiues = list(numsSet.keys())
  ans = set()
  for n in unqiues:
    for m in unqiues:
      o = -(n + m)
      if o in numsSet and n + m + o == 0:
        if n == m == o and len(numsSet[n]) < 3:
          continue
        if n == m and len(numsSet[n]) < 2:
          continue
        if m == o and len(numsSet[m]) < 2:
          continue
        if n == o and len(numsSet[n]) < 2:
          continue
        item = sorted([n, m, o])
        ans.add( ",".join(str(num) for num in item))
  return [[int(item) for item in items.split(',')] for items in ans]

